
const frameImage = document.getElementById('processed-image') as HTMLImageElement;


const statsDisplay = document.getElementById('stats-overlay');


const base64ImageData: string = ""; 


const frameStats = {
    resolution: "1280x720",
    fps: 30 
};


if (frameImage && statsDisplay) {
    
    frameImage.src = `data:image/png;base64,${base64ImageData}`;

    
    statsDisplay.textContent = `Resolution: ${frameStats.resolution}\nFPS: ${frameStats.fps}`;
}